import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Players.css';

export default function Players() {
  const [list, setList] = useState([]);               // minimal 10 players
  const [countries, setCountries] = useState({});     // map of id → { name, image_path }
  const [positions, setPositions] = useState({});     // map of id → position name
  const [modalPlayer, setModalPlayer] = useState(null);
  const [details, setDetails] = useState(null);

  useEffect(() => {
    // 1️⃣ Fetch the 10‑player list
    axios.get('/api/players-short')
      .then(r => setList(r.data.data))
      .catch(console.error);

    // 2️⃣ Fetch all countries once
    axios.get('/api/countries')
      .then(r => {
        const map = {};
        r.data.data.forEach(c => { map[c.id] = c; });
        setCountries(map);
      })
      .catch(console.error);

    // 3️⃣ Fetch all positions once
    axios.get('/api/positions')
      .then(r => {
        const map = {};
        r.data.data.forEach(p => { map[p.id] = p.name; });
        setPositions(map);
      })
      .catch(console.error);
  }, []);

  // When you click a player, fetch its full details
  useEffect(() => {
    if (!modalPlayer) return;
    axios.get(`/api/player/${modalPlayer.id}`)
      .then(r => setDetails(r.data))
      .catch(console.error);
  }, [modalPlayer]);

  return (
    <div className="players-container">
      <h2>Players</h2>
      <div className="players-grid">
        {list.map(p => {
          const country = countries[p.country_id];
          const flag = country?.image_path;
          const countryName = country?.name;
          // note: p.position isn’t on the short list; you'll only show position in the modal
          return (
            <div key={p.id}
                 className="player-card"
                 onClick={() => { setModalPlayer(p); setDetails(null); }}>
              <img src={p.image_path} alt={p.fullname} className="player-img"/>
              <h4>{p.fullname}</h4>
              {flag && (
                <div className="flag-info">
                  <img src={flag} alt={countryName} className="flag-icon"/>
                  <span>{countryName}</span>
                </div>
              )}
            </div>
          );
        })}
      </div>

      {modalPlayer && (
        <div className="modal-overlay" onClick={() => setModalPlayer(null)}>
          <div className="modal" onClick={e => e.stopPropagation()}>
            {!details
              ? <p>Loading details…</p>
              : <>
                  <h3>{details.fullname}</h3>
                  <img src={details.image_path} alt="" className="player-img"/>
                  <p><strong>Country:</strong> {details.country?.name}</p>
                  <p><strong>Position:</strong> {details.position?.name}</p>
                  <p><strong>DOB:</strong> {details.dateofbirth}</p>
                  <p><strong>Batting:</strong> {details.battingstyle}</p>
                  <p><strong>Bowling:</strong> {details.bowlingstyle}</p>
                  <button onClick={() => setModalPlayer(null)}>Close</button>
                </>
            }
          </div>
        </div>
      )}
    </div>
  );
}
